VALUES ('5949096018054', 'Comori nationale Turtă dulce', 'Făină albă de grau, zahar invertit, zahar, grasime vegetala nehidrogenata (de palmier), indulcitor (sirop de sorbitol), emulsifiant (lecitina de soia), agenti de afanare (carbonat de amoniu, carbonati de sodiu), sare iodata, pudra de scortisoara, pudra de cuisoare, stabilizator (difosfat disodic), colorant (dioxid de titan). Produsul conține: _gluten_, lecitină din _soia_.', 'https://static.openfoodfacts.org/images/products/594/909/601/8054/front_ro.4.400.jpg', '3.4', '1.4', '78.6', '32.8', '2', '6.8', '0.4', '0.15748031496063', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5949101000173', 'Fulga Desert din lapte cu ciocolata si alune', 'Lapte de vaca pasteurizat 9,9% grasime, smantana pasteurizata obtinuta din lapte de vaca, zahar, amidon modificat, pudra de cacao cu continut redus de grasime 1%, lapte praf degresat, alune 0,5%, sirop de glucoza, maltodextrina, agenti de ingrosare: caragenan, guma de guar, aroma, cu adaos de calciu si vitamina D3.', 'https://static.openfoodfacts.org/images/products/594/910/100/0173/front_ro.4.400.jpg', '8.5', '5.3', '19.2', '15.6', '0.3', '3', '0.13', '0.0511811023622047', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5949101000265', 'Zuzu dolce mousse cu gust de caramel', 'Desert Mousse cu gust de caramel Preparat pe baza de lapte cu gust de caramel Ingrediente: smântână pasteurizată 10% grasime (obtinută din lapte de vacă), zahar, sirop de glucoză, grasimi vegetale total hidrogenate (palmier, cocos), amidon modificat, agenți de îngroşare: E 410, E 406 caragenan; gelatină de vită, sirop de zahăr caramelizat 0,6%, emulsifianti: E 472a, E 472b; aromă naturală, proteine din lante requlator de aciditate: E 339; sare. Produs aerat cu nitrogen. Contine lactoză din lapte.', 'https://static.openfoodfacts.org/images/products/594/910/100/0265/front_en.4.400.jpg', '10', '7.1', '17.1', '14.2', '0.3', '3.4', '0.23', '0.0905511811023622', '0', '1');

